import { Link } from 'react-router-dom'

const Image = (props) => {
    const imgStyle = {
        height: '35vh',
        width: '100%',
        objectFit: 'cover'
    }
    
    return (
        <div className="member-img">
            <Link>
                <img src={props.ima} className={`img-fluid ${imgStyle}`} alt="" />
            </Link>
        </div>
    )
}

export default Image;
